import { Component, Input, OnInit } from '@angular/core';
import { EnqNSman, NSmanPersonalInfo } from '../../model/nsman.model';

@Component({
  selector: 'n2-nsman-tabs',
  templateUrl: './nsman-tabs.component.html',
  styleUrls: ['./nsman-tabs.component.scss']
})
export class NsmanTabsComponent implements OnInit {

  @Input() index: number;
  @Input() nsman: EnqNSman;
  
  nsmanInfo: NSmanPersonalInfo;

  constructor() {
    //
  }

  ngOnInit(): void {
    this.nsman.personalInfo.rank = this.nsman.serviceInfo.currRank;
    this.nsmanInfo = this.nsman.personalInfo;
    console.log("Rank added to NSmanInfo", this.nsmanInfo.rank);
  }

}
